description:
John Adams is a 2008 American television miniseries chronicling most of President John Adams's political life and his role in the founding of the United States. Paul Giamatti portrays John Adams. The miniseries was directed by Tom Hooper. Kirk Ellis wrote the screenplay based on the book John Adams by David McCullough. The biopic of John Adams and the story of the first fifty years of the United States was broadcast in seven parts by HBO between March 16 and April 20, 2008. John Adams received generally positive reviews, and many prestigious awards. As of 2011, the show has won more Emmy awards than any other miniseries, and four Golden Globe awards.
